=head1 DESCRIPTION

This structure defines which groups defined in the SAML assertion
attribute are to be mapped to the Grafana C<Admin> and C<Editor> roles
in the workspace. SAML authenticated users not part of C<Admin> or
C<Editor> role groups have C<Viewer> permission over the workspace.

=head1 ATTRIBUTES


=head2 Admin => ArrayRef[Str|Undef]

A list of groups from the SAML assertion attribute to grant the Grafana
C<Admin> role to.


=head2 Editor => ArrayRef[Str|Undef]

A list of groups from the SAML assertion attribute to grant the Grafana
C<Editor> role to.



